import React from 'react';
import bg from '../assets/landing/landingbg.png';
import '../styles/Community.css';


function Community() {
  return (
        <section id='community'>
        <div className="community_container">
            
            <div className="comm_logo">
                <div className="logo_comm">
                </div>
                <div className="mand_container">
                    <div className='rotating_mandala'>

                    </div>
                </div>
                
            </div>
            <div className="home_buttons">
                <button className='butt'>Login</button>
                <button className='butt'>Sign Up</button>

            </div>
            <div className="home_bg">
            </div>
        </div>
        </section>
    
  )
}

export default Community;
